import React from "react";
import "../style/login.css"

const Login = () => {
  return (
    <div class="page">
      <div class="title">Login Details:</div>
      <div class="field">
        <div class="label">Username</div>
        <input type="text" />
      </div>
      <div class="field">
        <div class="label">Password</div>
        <input type="password" />
      </div>
      <div class="field btns">
        <button class="prev-3 prev">
          Previous
        </button>
        <button class="submit">
          Submit
        </button>
      </div>
    </div>
  );
};

export default Login;
